import react from 'react'
import React, {Component} from 'react'
import {Link} from 'react-router-dom';

export default class Navbar extends Component{
    render() {
        return(
            <nav className = "navbar navbar-expand-sm navbar-dark navbar-dark px-xm-5" style="color:#aaaaaa;">
                <Link to="/">
                    <image src="" alt="home" className="navbar-brand" />
                </Link>
                <ul className="navbar-nav aign-items-center">
                    <li className="nav-item ml-5">
                        <Link to="/" className="nav-link">
                            Kaufen/verkaufen
                        </Link>
                    </li>
                </ul>

            </nav>
        )
    }
}
